const board = document.querySelector('#board')
createBoard()
const elements = document.querySelectorAll('.element')
const buttons = document.querySelectorAll('[data-number]')
const deleteButton = document.querySelector('[data-delete]')
const refresh = document.querySelector('.refresh')
const level = document.querySelector('#level')
const mistakesDisplay = document.querySelector('.mistakes')

let boardIndex = 0
var boardstr = ''
var solstr = ''
var sol = []
var mistakes = 0

init()

function init() {
    buttons.forEach(button => {
        button.classList.remove('finished')
    })
    let selectedLevel = level.value
    mistakes = 0
    boardIndex = Math.floor(Math.random()*475)
    switch(parseInt(selectedLevel)) {
        case 1:
            boardstr = boards.easy[boardIndex][0]
            solstr = boards.easy[boardIndex][1]
            break
        case 2:
            boardstr = boards.medium[boardIndex][0]
            solstr = boards.medium[boardIndex][1]
            break
        case 3:
            boardstr = boards.hard[boardIndex][0]
            solstr = boards.hard[boardIndex][1]
            break
        case 4:
            boardstr = boards.expert[boardIndex][0]
            solstr = boards.expert[boardIndex][1]
            break
        default:
            boardstr = boards.random[boardIndex][0]
            console.log("Default")
            break
    }
    console.log(boardstr)
    console.log(solstr)
    setBoard()
    setSol()
}


function createBoard() {
    for(let i = 0; i<9; i++) {
        let text = ""
        text += "<div>"
        for(let j = 0; j<9; j++) {
            let inputClass = "";
            if(i%3 == 0) {
                inputClass += "top-"
            } else if(i%3 == 1) {
                inputClass += "mid-"
            } else {
            inputClass += "bot-"
        }

        if(j%3 == 0) {
            inputClass += "left"
        } else if(j%3 == 1) {
            inputClass += "mid"
        } else {
            inputClass += "right"
        }

        if(i == 0 && j == 0) {
            inputClass += " top-left-corner"
        }
        if(i == 0 && j == 8) {
            inputClass += " top-right-corner"
        }
        if(i == 8 && j == 0) {
            inputClass += " bot-left-corner"
        }
        if(i == 8 && j == 8) {
            inputClass += " bot-right-corner"
        }
        text += '<input data-num="" type="number" value="" id="num' + i + "-" + j+ '"class="element ' + inputClass + '"' + ' readonly>'
    }
    text += "</div>"
    board.innerHTML += text
  }
}

function setBoard() {
    let boardArr = boardstr.split('')
    mistakesDisplay.innerText = '0'

    let i = 0
    let elements = document.querySelectorAll('.element')
    elements.forEach(element => {
        element.dataset.num = ''
        element.classList.remove('wrong')
        element.classList.remove('selected')
        element.style.color = "black"
        if(boardArr[i] != '.') {
            element.value = boardArr[i]
            element.classList.add('set-board')
            element.dataset.num = boardArr[i].toString()
        } else {
            element.value = ''
            element.classList.remove('set-board')
        }
        i++
    })

}

function setSol() {
    sol = []
    let solArr = solstr.split('')
    let count = 0;
    
    for(let j = 0; j <9; j++) {
        sol.push([])
        for(let k = 0; k<9; k++) {
            sol[j].push(parseInt(solArr[count]))
            count++
        }
    }
}

function fillBoard() {
    let elements = document.querySelectorAll('.element')
    let i = 0
    elements.forEach(element => {
        element.value = sol[element.id.charAt(3)][element.id.charAt(5)]
        if(!element.classList.contains('set-board')) {
            element.style.color = "#1c7401bd"
        }
        i++
    })
}

document.addEventListener('click', () => {
    mistakes = document.querySelectorAll('.wrong').length 
    
    mistakesDisplay.innerText = mistakes
    if(mistakes >= 3) {
        fillBoard()
        alert("You have made too many mistakes!!")
    }
})

var selectedElement
var previousElement
let a = 0

elements.forEach(element => {
    
    element.addEventListener('click', () => {
        previousElement = selectedElement
        selectedElement = document.activeElement

        elements.forEach(square => {
            if(a!=0 && (((square.id.charAt(3)==previousElement.id.charAt(3) || square.id.charAt(5)==previousElement.id.charAt(5)) && square.id.charAt(3)!=selectedElement.id.charAt(3) && square.id.charAt(5)!=selectedElement.id.charAt(5)) || (square.dataset.num == previousElement.dataset.num && square.dataset.num!=selectedElement.dataset.num))) {
                square.classList.remove('selected')
            }
            if(square.id.charAt(3)==selectedElement.id.charAt(3) || square.id.charAt(5)==selectedElement.id.charAt(5) || (square.dataset.num == selectedElement.dataset.num && square.value!='')) {
                square.classList.add('selected')
            }
        })
        a++
        
        buttons.forEach(button => {
            button.addEventListener('click', () => {
                elements.forEach(square => {
                    if(square.id.charAt(3)==selectedElement.id.charAt(3) || square.id.charAt(5)==selectedElement.id.charAt(5) || element.classList.contains('set-board')) {
                        square.classList.remove('selected')
                    }
                })
                if(!selectedElement.classList.contains('set-board')) {
                    selectedElement.value = button.innerText
                    if(parseInt(sol[selectedElement.id.charAt(3)][selectedElement.id.charAt(5)]) == parseInt(button.innerText)) {
                        selectedElement.style.color = "#1446b3"
                        selectedElement.dataset.num = button.innerText
                    } else {
                        selectedElement.classList.add('wrong')
                        selectedElement.style.color = "#e60f0fa1"
                    }
                }
                for(let number = 1; number <=9; number++) {
                    let str = '[data-num="' + number + '"]'
                    if(document.querySelectorAll(str).length == 9) {
                        buttons.forEach(btn => {
                            if(btn.classList.contains(number.toString())) {
                                btn.classList.add('finished')
                            }
                        })
                    }
                }
            })
        })

        deleteButton.addEventListener('click', () => {
            if(!selectedElement.classList.contains('set-board')) {
                selectedElement.value = ''
            }
        })

        document.addEventListener('keydown', function(event) {
            elements.forEach(square => {
                if(square.id.charAt(3)==selectedElement.id.charAt(3) || square.id.charAt(5)==selectedElement.id.charAt(5) || element.classList.contains('set-board')) {
                    square.classList.remove('selected')
                }
            })
            if(!selectedElement.classList.contains('set-board')) {
                selectedElement.value = event.key
                if(parseInt(sol[selectedElement.id.charAt(3)][selectedElement.id.charAt(5)]) == parseInt(event.key)) {
                    selectedElement.style.color = "#1446b3"
                    selectedElement.dataset.num = event.key
                } else {
                    selectedElement.classList.add('wrong')
                    selectedElement.style.color = "#e60f0fa1"
                }
            }
            for(let number = 1; number <=9; number++) {
                let str = '[data-num="' + number + '"]'
                if(document.querySelectorAll(str).length == 9) {
                    buttons.forEach(btn => {
                        if(btn.classList.contains(number.toString())) {
                            btn.classList.add('finished')
                        }
                    })
                }
            }            
        })
    })
})

refresh.addEventListener('click', () => {
    init()
})

level.addEventListener('change', () => {
    init()
})